    function openModal() {
        setIsOpen(true);
    }

    function afterOpenModal() {
        // references are now sync'd and can be accessed.
        subtitle.style.color = '#f00';
    }

    function closeModal() {
        setIsOpen(false);
    }

  return (
    <div id="CreateFlowModal" style={{display:'none'}}>

        <div class="modal-content">
            <div class="modal-header">
                <span class="close_CreateFlowModal_btn">&times;</span>
                <h2>Modal Header</h2>
            </div>
            <div class="modal-body">
            <p>Some text in the Modal Body</p>
            <p>Some other text...</p>
            </div>
